<p>可以使用DOM将任何HTML或XML文档表示为节点的层次结构。有多种节点类型，每种节点类型代表文档中的不同信息或标记。每种节点类型具有不同的特性、数据和方法，并且每种节点可能与其他节点有关系。这些关系创建了一个层次结构，该层次结构允许将标记表示为以特定节点为根的树。</p>
