<p>术语“迭代”源自拉丁语itero，表示“重复”或“再次执行”。在软件的环境中，“迭代”是指按顺序重复执行一个程序多次，并且通常期望终止。 ES6规范引入了两个高级功能（迭代器和生成器），以实现更简洁，更快和更容易的迭代。</p>
